import React from 'react';
import Feed from '../Feed';

const ArticleList = ({ title, articles }) => {
  return (
    <div>
      <h2>{title}</h2>
      {articles.map((item, i) => (
        <Feed
          key={i}
          content={item.content}
          contentSnippet={item.contentSnippet}
          title={item.title}
          link={item.link}
          date={item.pubDate}
        />
      ))}
    </div>
  );
};

export default ArticleList;
